import React, { useState } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "../components/Home/home";
import Korea from "../components/Korea/korea";

import "./syles.scss";

function Routes() {
  const [select, setSelect] = useState("qqq");

  const form = select === "japan" ? <Home /> : <Korea />;

  if (select === "japan") {
    return <Home></Home>;
  } else if (select === "korea") {
    return <Korea></Korea>;
  } else {
    return <></>;
  }
  return (
    <Router>
      <Switch>
        <Route path="/">
          <div className="selectLang">
            <button className="korea" onClick={() => setSelect("korea")}>
              korea
            </button>
            <button className="japan" onClick={() => setSelect("japan")}>
              japaneess
            </button>
          </div>
          {form}
        </Route>
      </Switch>
    </Router>
  );
}

export default Routes;
